syntax = "proto3";
package com.tencent.log;

message lala {
	string why = 1;
	float test = 2;
	string ssv = 3;
	string http = 4;
	float woca2 = 5;
	float woca = 6;
}

message papa {
	string why = 1;
	bool not = 2;
	float vvv = 3;
}

message NormalSetting {
	lala lala2 = 1;
	lala lala3 = 2;
	repeated papa papa = 3;
	int32 one = 4;
	int32 two = 5;
	string three = 6;
	float four_game = 7;
	lala lala = 8;
}